INSERT INTO `posts` (`id`, `author_id`, `title`, `description`, `content`, `date`) VALUES (1, 1, 'Voluptas accusantium est doloribus cupiditate omnis ratione.', 'In assumenda tempore omnis quas ad. In tempora quo omnis consequatur libero aut quasi. Autem modi blanditiis velit maiores maiores magnam corrupti. Minima necessitatibus accusamus voluptate magnam possimus placeat.', 'Ex aut minima autem libero deserunt enim. Excepturi sunt quaerat autem sunt nam amet. Ipsum voluptas a magnam quo magnam sit facilis non.', '2004-07-05');
INSERT INTO `posts` (`id`, `author_id`, `title`, `description`, `content`, `date`) VALUES (2, 2, 'Fuga eum nostrum dolores ab.', 'Ducimus totam placeat quis dolor libero nobis repudiandae. Qui numquam minus distinctio mollitia suscipit nihil.', 'Excepturi ratione et rerum aut dolore dicta ut non. Quae iste libero reiciendis est. Qui saepe accusantium est omnis odio.', '2003-04-06');
INSERT INTO `posts` (`id`, `author_id`, `title`, `description`, `content`, `date`) VALUES (3, 3, 'Omnis consectetur magnam magni perspiciatis ut.', 'Distinctio quo aut ab ipsam quia distinctio. Rem qui harum sed. Ea omnis unde et veniam eaque. Vitae aspernatur consequatur culpa quo illum.', 'Molestiae sint quo quis harum. Quia dolorem velit quos possimus. Consequuntur omnis eius iure magni odio natus.', '1987-09-02');
INSERT INTO `posts` (`id`, `author_id`, `title`, `description`, `content`, `date`) VALUES (4, 4, 'Unde quibusdam omnis est consectetur molestias eum et.', 'Nihil est non vitae id unde. Facere inventore non alias dolorem exercitationem et. Quis eaque dolorum eligendi est officia.', 'Facilis vero magni qui nobis. Est error voluptas eligendi dolorem.', '1997-10-22');
